import { Container } from "@material-ui/core";
import { useContext, useState } from "react";
import { Nav, Navbar } from "react-bootstrap";
import { useHistory } from "react-router-dom";
import ShoppingBasketIcon from '@material-ui/icons/ShoppingBasket';
import FavoriteIcon from '@material-ui/icons/Favorite';
import MeetingRoomIcon from '@material-ui/icons/MeetingRoom';
import HomeIcon from '@material-ui/icons/Home';
import InputIcon from '@material-ui/icons/Input';
import PersonIcon from '@material-ui/icons/Person';
import { end } from "./Logged";

const Menu=()=>{

    

    return(<>
        <Navbar bg="light" expand="md">
                <Container>
                    <Navbar.Brand href="#">Dlithe E - Buddy</Navbar.Brand>
                    <Navbar.Toggle aria-control="logitems"></Navbar.Toggle>
                    <Navbar.Collapse id="logitems">
                        <Nav className="ms-auto">
                            <Nav.Link href="/" className="me-3 text-dark btn btn-outline-primary">
                                        Home
                                    </Nav.Link>
                                    <Nav.Link href="/new" className="me-3 text-dark btn btn-outline-primary">
                                        New
                                    </Nav.Link>
                                    <Nav.Link href="/edit" onClick={check} className="me-3 text-dark btn btn-outline-primary">
                                        Edit
                                    </Nav.Link>
                                    <Nav.Link href="/delete" className="me-3 text-dark btn btn-outline-primary">
                                        Delete
                                    </Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
    </>)
}
export default Menu;
